import React from "react";

const Home = () => {
  return (
    <>
      <div className="container-fluid  fixed-top navitem">
        <div className="row">
          <div className="col-10 mx-autor">
            <div className="row">
              <h1>home page</h1>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Home;
